import React, { useState } from 'react';
import './HeroSection.css';

const citiesInPakistan = [
  "Islamabad",
  "Lahore",
  "Karachi",
  "Murree",
  "Peshawar",
  "Skardu",
  "Hunza",
  "Quetta",
  "Multan",
  "Faisalabad",
];

const HeroSection = () => {
  const [startingPoint, setStartingPoint] = useState('');
  const [destination, setDestination] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [guests, setGuests] = useState(1);

  const handleSearch = (e) => {
    e.preventDefault();
    // Implement search functionality here
    console.log('Search:', { startingPoint, destination, startDate, endDate, guests });
  };

  return (
    <div className="hero-section">
      <div className="hero-content">
        <h1>BOOK UNIQUE EXPERIENCES</h1>
        <p>Explore top rated tours, hotels, and restaurants around the world</p>
        <form onSubmit={handleSearch} className="search-form">
          {/* Starting Point Input */}
          <div className="search-input">
            <i className="fas fa-map-marker-alt"></i>
             <select
              value={startingPoint}
              onChange={(e) => setStartingPoint(e.target.value)}
              placeholder="Starting Point"
            >
              <option value="" disabled>Select a City</option>
              {citiesInPakistan.map((city, index) => (
                <option key={index} value={city}>{city}</option>
              ))}
            </select>
          </div>

          {/* Destination Dropdown */}
          <div className="search-input">
            <i className="fas fa-map-marker-alt"></i>
            <select
              value={destination}
              onChange={(e) => setDestination(e.target.value)}
              placeholder="Where are you going?"
            >
              <option value="" disabled>Select a City</option>
              {citiesInPakistan.map((city, index) => (
                <option key={index} value={city}>{city}</option>
              ))}
            </select>
          </div>

          {/* Start Date Input */}
          <div className="search-input">
            <i className="far fa-calendar-alt"></i>
            <input
              type="date"
              placeholder="Start Date"
              value={startDate}
              onChange={(e) => setStartDate(e.target.value)}
            />
          </div>

          {/* End Date Input */}
          <div className="search-input">
            <i className="far fa-calendar-alt"></i>
            <input
              type="date"
              placeholder="End Date"
              value={endDate}
              onChange={(e) => setEndDate(e.target.value)}
            />
          </div>

          {/* Guests Input */}
          <div className="search-input">
            <i className="fas fa-user-friends"></i>
            <select
              value={guests}
              onChange={(e) => setGuests(Number(e.target.value))}
            >
              <option value="1">1 Guest</option>
              <option value="2">2 Guests</option>
              <option value="3">3 Guests</option>
              <option value="4">4+ Guests</option>
            </select>
          </div>

          {/* Search Button */}
          <button type="submit" className="search-button">Search</button>
        </form>
      </div>
    </div>
  );
};

export default HeroSection;
